import Vue from "vue";
import ElementUI from "element-ui";
import 'element-ui/lib/theme-chalk/index.css'
import BootstrapVue from 'bootstrap-vue'
import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap-vue/dist/bootstrap-vue.css'

Vue.use(BootstrapVue);
Vue.use(ElementUI);

export default ({
    name: 'App',
    data() {
        return {
            id_gen: 1,
            id_photo: -1,
            activeTab: "first",
            unusedData: "stub",
            svg: "",
            file: "",
            selectedText: {
                text: "Default text",
                font: "Comic Sans",
                color: "black",
                id: -1
            }
        };
    },
    beforeCreate: function () {
        this.id_photo = this.id_gen;
        this.selectedText.id = this.id_gen + 1;
    },

    methods: {
        setSVG(data) {
            this.svg = data;
        },

        setData(payload) {
            if (payload.selectedText) {
                this.selectedText = payload.selectedText;
            }
        },

        handleAddText() {
            this.id_gen += 1;
            this.$emit("addText", this.selectedText);
        },

        handleDelete() {
            this.$emit("deleteClick");
        },

        handleToFront() {
            this.$emit("toFrontClick");
        },

        handleToBack() {
            this.$emit("toBackClick");
        },

        handleExport() {
            this.$emit("exportSVG");
        },

        handleImport() {
            this.$emit("importSVG", this.svg);
        },

        handleClick(event) {
            this.$emit("buttonClick", event);
        },

        handleImportIMG() {
            this.$emit("importIMG", this.file);
        }
    }
});
